import Loader from "../Loader"
import { RandomSongsList } from "./index.style"

const SectionHome = ({ randomSongs, handleSongSelect }) => {
  return (
    <section>
      <h1> Random songs </h1>
      {randomSongs
        ? <RandomSongsList>
            {randomSongs.map(song =>
              <li key={song.id} onClick={() => handleSongSelect(song.id, 'song')}>
                {song.full_title}
              </li>
            )}
          </RandomSongsList>
        : <Loader />
      }
    </section>
  )
}

export default SectionHome
